import Error404Page from "../../pages/Error404Page"
import MyPosts from "../../pages/MyPosts"
import { DataRouterItemType } from "../../types/Interfaces"

export const DataPaths: DataRouterItemType[] = [
    {
        path: '*',
        element: <Error404Page />,
        id: 1
    },
    {
        path: '/MyPosts',
        element: <MyPosts />,
        id: 2
    }
]
